import React, { Component } from 'react';
import "./ClassId.css";

class ClassId extends Component {
    constructor() {
        super();
        this.state = {
            checkBoxDefaultStatus: false
        }
        this.handleSelect = this.handleSelect.bind(this);
    }
    handleSelect() {
        this.setState({
            checkBoxDefaultStatus: !this.state.checkBoxDefaultStatus
        })
    }

    render() {
        return (
            <div className="classId">
                <div class="input-group mb-3">
                    <div class="form-check">
                        {/* possibly need this code checked={this.state.checkBoxDefaultStatus} */}
                        <input onclick={() => { this.handleSelect() }} class="form-check-input" type="checkbox" value="" id="flexCheckDefault" />
                    </div>
                    <div class="col-auto">
                        <input type="classid" class="form-control" id="classid" placeholder="            Class Code" />
                    </div>
                </div>
            </div>
        )
    }
}

export default ClassId;
